import React from 'react';
import './App.css';
import Header from './components/Header';
import Welcome from './components/Welcome';
import Posts from './components/Posts';

function App() {
  return (
    <div className="App">
      <Header />
      <Welcome />
      <Posts />
    </div>
  );
}

export default App;
